interface types {
    assertNumber(input: any): number;
    assertInt(input: any): number;
    assertString(input: any): string;
    assertBoolean(input: any): boolean;
    assertBigInt(input: any): bigint;
    assertSymbol(input: any): symbol;
    assertUndefined(input: any): undefined;
    assertFunction(input: any): Function;
    assertObject(input: any): object;
}

